import React, { Component } from 'react';
import { Label, FormText, Button, Container, Form, FormGroup, Input} from "reactstrap";

class Rank extends Component {
	handleSubmit(event) {}
	handleChange(event) {}
	focusInput(component) {}
	tryAgain() {}



  render() {
    return (
      <div>
      	<Button outline color="info">info</Button>{' '}

      <Form onSubmit={this.handleSubmit}>
      	<FormGroup>
          <Label for="exampleFile">File</Label>
          <Input type="file" name="file" id="exampleFile" />
          <FormText color="muted">
            This is some placeholder block-level help text for the above input.
            It's a bit lighter and easily wraps to a new line.
          </FormText>
        </FormGroup>

        <FormGroup role="form">
          <Input
            type="textarea"
            placeholder="You can enter as little as 100 words, but for a more accurate analysis, you need more words. Watson requires a minimum of 600, preferably 1,200 or more, to compute statistically significant estimates."
            name="raw-text-content"
            id="raw-text-content"
            onChange={this.handleChange}
            ref={this.focusInput}
          />
        </FormGroup>

        <Button
          type="submit"
          size="lg">
          Analyse
        </Button>
      </Form>

      </div>
    );
  }
}

export default Rank;
